import React, { Component } from "react";

class Main extends Component {
  render() {
    return (
      <div>
        <h1 key={this.props.person.id}>
          Hello! My name is {this.props.person.name}. I am {this.props.person.age}. I am
          studying {this.props.person.skill}
        </h1>
      </div>
    );
  }
}

export default Main;
